import jsPDF from 'jspdf';
import autoTable from 'jspdf-autotable';

const ICON_CAR = 'data:image/png;base64,';
const ICON_MARCA = 'data:image/png;base64,';
const ICON_COR = 'data:image/png;base64,';
const ICON_RENAVAM = 'data:image/png;base64,';
const ICON_CHASSI = 'data:image/png;base64,';
const ICON_SEG = 'data:image/png;base64,';
const ICON_POSICAO = 'data:image/png;base64,';
const ICON_COLABORADOR = 'data:image/png;base64,';
const ICON_ANO = 'data:image/png;base64,';
const ICON_PLACA = 'data:image/png;base64,';

// Funo auxiliar para formatar datas (Corrigida para evitar datas invlidas)
const formatDate = (dateString) => {
  if (!dateString || dateString === '0000-00-00' || dateString === '1969-12-31') {
    return 'N/A';
  }
  try {
    const date = new Date(dateString);
    // Ajusta para o fuso horrio local (evita problemas de UTC de um dia)
    const userTimezoneOffset = date.getTimezoneOffset() * 60000;
    const correctedDate = new Date(date.getTime() + userTimezoneOffset);
    return correctedDate.toLocaleDateString('pt-BR', { 
      day: '2-digit', 
      month: '2-digit', 
      year: 'numeric' 
    });
  } catch (e) {
    return dateString; // Retorna a string original se falhar
  }
};

// Funo auxiliar para formatar datas e horas
const formatDateTime = (dateString) => {
    if (!dateString) return 'Data no disponvel';
    try {
        const dateObj = new Date(dateString);
        if (isNaN(dateObj.getTime())) return 'Data invlida';
        
        return dateObj.toLocaleDateString('pt-BR', {
            day: '2-digit',
            month: '2-digit',
            year: 'numeric',
            hour: '2-digit',
            minute: '2-digit'
        });
    } catch (error) {
        return 'Data no disponvel';
    }
};

// Funo auxiliar para evitar 'null' ou 'undefined'
const field = (value) => value || '';

// Funo auxiliar para validar se um cone base64  vlido
const isValidIcon = (iconString) => {
  if (!iconString || typeof iconString !== 'string') {
    return false;
  }
  // Verificar se  um data URI vlido
  if (!iconString.startsWith('data:image')) {
    return false;
  }
  // Verificar se no contm placeholders incompletos
  if (iconString.includes('...')) {
    return false;
  }
  // Verificar se tem contedo base64 aps o prefixo
  const base64Part = iconString.split(',')[1];
  if (!base64Part || base64Part.length < 100) {
    return false;
  }
  return true;
};

// Funo auxiliar para adicionar cone com tratamento de erro
const addIconSafely = (doc, iconString, x, y, width, height) => {
  if (!isValidIcon(iconString)) {
    return false; // cone invlido, no adiciona
  }
  try {
    // Determinar o tipo de imagem baseado no data URI
    let imageType = 'PNG';
    if (iconString.includes('svg')) {
      imageType = 'SVG';
    } else if (iconString.includes('jpeg') || iconString.includes('jpg')) {
      imageType = 'JPEG';
    }
    
    doc.addImage(iconString, imageType, x, y, width, height);
    return true;
  } catch (error) {
    // Se falhar com PNG, tentar SVG ou vice-versa
    try {
      const fallbackType = iconString.includes('svg') ? 'PNG' : 'SVG';
      doc.addImage(iconString, fallbackType, x, y, width, height);
      return true;
    } catch (e) {
      console.warn('Erro ao adicionar cone ao PDF:', e);
      return false;
    }
  }
};

// Funo auxiliar para quebrar texto longo em mltiplas linhas
const drawTextWithWrap = (doc, text, x, y, maxWidth, fontSize, fontStyle = 'normal') => {
  doc.setFontSize(fontSize);
  doc.setFont(undefined, fontStyle);
  
  // Quebra o texto em mltiplas linhas se necessrio
  const lines = doc.splitTextToSize(field(text), maxWidth);
  
  // Se no houver texto ou for apenas uma linha, desenha normalmente
  if (lines.length <= 1) {
    doc.text(lines[0] || '', x, y);
    return y;
  }
  
  // Desenha cada linha com espaamento adequado (ajustado para fontes menores)
  const lineSpacing = fontSize * 0.45; // Espaamento entre linhas (otimizado para fontes menores)
  let currentY = y;
  
  lines.forEach((line, index) => {
    doc.text(line, x, currentY);
    if (index < lines.length - 1) { // No adiciona espaamento aps a ltima linha
      currentY += lineSpacing;
    }
  });
  
  // Retorna a posio Y final aps desenhar todas as linhas
  return currentY;
};

export const generateEntradaReport = (registro, usuarioLogado) => {
  const doc = new jsPDF();
  const pageHeight = doc.internal.pageSize.height || doc.internal.pageSize.getHeight();
  const pageWidth = doc.internal.pageSize.width || doc.internal.pageSize.getWidth();
  
  // --- Configuraes de Layout (Otimizado para mais espao til) ---
  // Centralizar contedo (exceto o cabealho)
  const contentWidth = 170; // Largura do contedo centralizado (mm) - Reduzido de 170 para 155 para criar gap visvel
  const leftOffset = (pageWidth - contentWidth) / 2; // Offset esquerdo para centralizar
  const margin = leftOffset; // Margem esquerda centralizada
  const columnGap = 6; // Espaamento entre as colunas (em mm) - Aumentado de 4 para 6 para gap mais visvel
  const col2X = leftOffset + (contentWidth - columnGap) / 2 + columnGap; // Posio X da segunda coluna com gap
  const rightMargin = leftOffset + contentWidth; // Margem direita centralizada
  const labelValueSpacing = 2; // Espao entre o rtulo e o valor (reduzido para ficar prximo)
  const lineHeight = 6; // Aumentado de 5 para 6 para mais espaamento
  const sectionSpacing = 16; // Aumentado de 6 para 8 para mais espaamento entre sees
  let y = 12; // Reduzido de 20 para 12

  // --- CABEALHO ---
  doc.setFontSize(16); // Aumentado de 13 para 16
  doc.setFont(undefined, 'bold');
  doc.text('BRS BERNARDO REGULADORA DE SINISTROS', pageWidth / 2, y, { align: 'center' });
  const headerEndY = y + 9; // Posio final do cabealho

  // Calcular altura estimada do contedo (protocolo at footer)
  // Protocolo: ~15mm
  // INFORMAES VECULO: ~100mm (estimativa conservadora)
  // DADOS DE LOCALIZAO/ROUBO/FURTO: ~45mm
  // OBSERVAES: ~60mm (10 linhas  6mm)
  // Footer: ~10mm
  // Total estimado: ~230mm
  const estimatedContentHeight = 230; // Altura estimada do contedo em mm
  const headerHeight = headerEndY; // Altura ocupada pelo cabealho
  const availableHeight = pageHeight - headerHeight; // Altura disponvel aps o cabealho
  const verticalOffset = (availableHeight - estimatedContentHeight) / 2; // Offset para centralizar
  
  // Aplicar offset para centralizar verticalmente o contedo (aps o cabealho)
  y = headerEndY + Math.max(0, verticalOffset); // Garantir que no seja negativo

  // --- DADOS DO PROTOCOLO ---
  const protocolo = field(registro.Protocolo || registro.PROTOCOLO || registro.id || registro.Id_Entrada);
  const posicao = field(registro.Posicao || registro.POSICAO || '');
  const dataEntrada = formatDate(registro.Data_Entrada || registro.DATA_ENTRADA || registro.data_entrada);
  
  doc.setFontSize(10); // Reduzido de 12 para 10
  doc.setFont(undefined, 'bold');
  doc.text(`PROTOCOLO: ${protocolo}`, margin, y);
  
  doc.setFont(undefined, 'normal');
  doc.text(`Posio: ${posicao}`, pageWidth / 2, y, { align: 'center' });
  doc.text(`DATA DE ENTRADA: ${dataEntrada}`, rightMargin, y, { align: 'right' });
  y += 6; // Aumentado de 4 para 6 para mais espaamento aps protocolo
  y += sectionSpacing;

  // --- NOVA LGICA DE BLOCOS (Moderno e Estilizado) ---
  
  // Constantes para cones
  const iconSize = 6; // Tamanho do cone em mm
  const iconTextSpacing = 2; // Espao entre o cone e o texto
  
  // Funo auxiliar para desenhar sees de 2 colunas
  const drawSection = (title, leftItems, rightItems = [], drawBorder = false) => {
    if(y > pageHeight - 30) { // Check de quebra de pgina (ajustado para mais espao)
       doc.addPage();
       y = 12;
    }

    const sectionStartY = y - 4; // Posio Y inicial da seo (incluindo espao para borda)
    const sectionStartX = margin - 2; // Posio X inicial da seo (com margem para borda)

    doc.setFontSize(11); // Aumentado de 9 para 11
    doc.setFont(undefined, 'bold');
    doc.text(title, margin, y);
    y += (lineHeight * 1.4); // Aumentado de 1.2 para 1.4 para mais espaamento aps ttulo
    
    // Determina o nmero mximo de linhas (o lado mais comprido)
    const maxRows = Math.max(leftItems.length, rightItems.length);

    for (let i = 0; i < maxRows; i++) {
      if(y > pageHeight - 20) { // Check de quebra de pgina dentro do loop (ajustado)
         doc.addPage();
         y = 12;
      }

      let maxYForRow = y; // Armazena a posio Y mais baixa desta linha

      // --- Coluna da Esquerda ---
      if (i < leftItems.length) {
        const item = leftItems[i];
        
        // Desenhar cone se existir
        let iconOffset = 0; // Offset para ajustar posio do texto se houver cone
        if (item.icon) {
          const iconX = margin;
          const iconY = y - (iconSize - 1); // Ajustar posio Y do cone
          const iconAdded = addIconSafely(doc, item.icon, iconX, iconY, iconSize, iconSize);
          if (iconAdded) {
            iconOffset = iconSize + iconTextSpacing;
          }
        }
        
        doc.setFontSize(10); // Aumentado de 8 para 10
        doc.setFont(undefined, 'bold');
        const labelText = `${item.label}:`;
        const labelX = margin + iconOffset;
        doc.text(labelText, labelX, y); // Rtulo (Negrito)
        
        // Calcular posio X do valor baseado na largura do rtulo
        const labelWidth = doc.getTextWidth(labelText);
        const valueX = labelX + labelWidth + labelValueSpacing;
        const col1EndX = col2X - columnGap; // Fim da coluna esquerda (antes do gap)
        let maxWidthLeft = col1EndX - valueX - 5; // Largura disponvel na coluna esquerda (considerando gap)
        
        // Para "POSIO DO PROCESSO", aumentar a largura para evitar quebra de linha
        if (item.label === 'POSIO DO PROCESSO') {
          maxWidthLeft = rightMargin - valueX - 5; // Usar toda a largura disponvel
        }
        
        // Para "COLABORADOR RESP.", aumentar a largura para evitar quebra de linha
        if (item.label === 'COLABORADOR RESP.') {
          maxWidthLeft = rightMargin - valueX - 5; // Usar toda a largura disponvel
        }
        
        // Desenhar valor com quebra de linha
        doc.setFontSize(11); // Aumentado de 9 para 11
        doc.setFont(undefined, 'normal');
        const finalY = drawTextWithWrap(doc, item.value, valueX, y, maxWidthLeft, 11, 'normal'); // Aumentado de 9 para 11
        maxYForRow = Math.max(maxYForRow, finalY);
      }
      
      // --- Coluna da Direita ---
      if (i < rightItems.length) {
        const item = rightItems[i];
        
        // Desenhar cone se existir
        let iconOffset = 0; // Offset para ajustar posio do texto se houver cone
        if (item.icon) {
          const iconX = col2X;
          const iconY = y - (iconSize - 1); // Ajustar posio Y do cone
          const iconAdded = addIconSafely(doc, item.icon, iconX, iconY, iconSize, iconSize);
          if (iconAdded) {
            iconOffset = iconSize + iconTextSpacing;
          }
        }
        
        doc.setFontSize(10); // Aumentado de 8 para 10
        doc.setFont(undefined, 'bold');
        const labelText = `${item.label}:`;
        const labelX = col2X + iconOffset;
        doc.text(labelText, labelX, y); // Rtulo (Negrito)
        
        // Calcular posio X do valor baseado na largura do rtulo
        const labelWidth = doc.getTextWidth(labelText);
        const valueX = labelX + labelWidth + labelValueSpacing;
        const maxWidthRight = rightMargin - valueX - 5; // Largura disponvel na coluna direita
        
        // Desenhar valor com quebra de linha
        doc.setFontSize(11); // Aumentado de 9 para 11
        doc.setFont(undefined, 'normal');
        const finalY = drawTextWithWrap(doc, item.value, valueX, y, maxWidthRight, 11, 'normal'); // Aumentado de 9 para 11
        maxYForRow = Math.max(maxYForRow, finalY);
      }
      
      // Move Y para a posio mais baixa desta linha (considerando quebras de linha)
      y = maxYForRow + lineHeight;
    }
    
    const sectionEndY = y; // Posio Y final da seo (antes da linha separadora)
    
    // Desenhar borda preta ao redor da seo se solicitado
    if (drawBorder) {
      doc.setDrawColor(0, 0, 0); // Cor preta
      doc.setLineWidth(0.5); // Espessura da linha
      const sectionWidth = rightMargin - sectionStartX + 4; // Largura da seo (incluindo margens)
      const sectionHeight = sectionEndY - sectionStartY; // Altura da seo
      doc.rect(sectionStartX, sectionStartY, sectionWidth, sectionHeight);
      // Se houver borda, no desenhar linha cinza
      y += sectionSpacing; // Espao aps a seo com borda
    } else {
      // Apenas desenhar linha cinza se no houver borda
      y += (sectionSpacing / 2); // Espao antes da linha
      doc.setDrawColor(180, 180, 180); // Cor da linha cinza claro
      doc.line(margin, y, rightMargin, y); // Linha separadora
      y += sectionSpacing; // Espao aps a seo
    }
  };

  // Funo auxiliar para formatar ano
  const formatAno = (anoVeiculo, anoModelo) => {
    const anoV = anoVeiculo ? String(anoVeiculo).trim() : '';
    const anoM = anoModelo ? String(anoModelo).trim() : '';
    
    if (anoV && anoM && anoV !== anoM) {
      return `${anoV}/${anoM}`;
    }
    return anoV || anoM || '';
  };

  // --- INFORMAES VECULO ---
  const anoFormatado = formatAno(registro.ANO_VEIC || registro.ANO_VEICULO, registro.ANO_MODELO || registro.ANO_MODELO);
  
  drawSection('INFORMAES VECULO', [
    { icon: ICON_MARCA, label: 'MARCA', value: registro.MARCA || '' },
    { icon: ICON_CAR, label: 'VECULO', value: registro.VEICULO || '' },
    { icon: ICON_COR, label: 'COR DO VECULO', value: registro.COR_VEICULO || registro.COR || registro.COR_DO_VEICULO || '' },
    { icon: ICON_RENAVAM, label: 'RENAVAM', value: registro.RENAVAM || '' },
    { icon: ICON_CHASSI, label: 'CHASSI', value: registro.CHASSI || '' },
    { icon: ICON_SEG, label: 'SEGURADORA', value: registro.SEGURADORA || '' },
    { icon: ICON_POSICAO, label: 'POSIO DO PROCESSO', value: registro.POSICAO || registro.Posicao || '' },
    { icon: ICON_COLABORADOR, label: 'COLABORADOR RESP.', value: registro.colaborador_nome || '' },

  ], [
    { icon: ICON_ANO, label: 'ANO', value: anoFormatado },
    { icon: ICON_PLACA, label: 'PLACA', value: registro.PLACA || '' },
    { icon: ICON_CAR, label: 'CD SINISTRO', value: registro.COD_SINISTRO || registro.N_Sinistro || '' },
    { icon: ICON_CAR, label: 'STATUS PROCESSO', value: registro.TIPO || registro.TIPO_SERVICO || registro.Tipo_Servico || '' },
  ], true); // Desenhar borda

  // Verificar se precisa de nova pgina antes das prximas sees
  if (y > pageHeight - 40) { // Ajustado de 60 para 40
    doc.addPage();
    y = 12;
  }

  // --- DADOS DE LOCALIZAO E ROUBO/FURTO (lado a lado) ---
  const sectionTitleY = y;
  
  // Calcular dimenses e posies para as duas sees independentes
  const padding = 3; // Padding interno (em mm)
  const gap = 12; // Espao entre as duas sees (em mm)
  const extraHeight = 10; // Altura extra para aumentar o tamanho das sees (em mm)
  const totalContentWidth = rightMargin - margin; // Largura total do contedo
  const sectionContentWidth = (totalContentWidth - gap) / 2; // Largura do contedo de cada seo (sem padding)
  
  // Ttulo "DADOS DE LOCALIZAO"
  doc.setFontSize(11); // Aumentado de 9 para 11
  doc.setFont(undefined, 'bold');
  doc.text('DADOS DE LOCALIZAO', margin, sectionTitleY);
  
  // Ttulo "DADOS DO ROUBO/FURTO" (lado direito - posio calculada baseada no gap)
  const rightSectionX = margin + sectionContentWidth + gap; // Posio X da seo direita (com gap entre as sees)
  doc.text('DADOS DO ROUBO/FURTO', rightSectionX, sectionTitleY);
  
  y = sectionTitleY + (lineHeight * 1.4); // Aumentado de 1.2 para 1.4 para mais espaamento aps ttulo
  
  // Desenhar as duas sees lado a lado (completamente independentes)
  const sectionLineHeight = 5; // Aumentado de 5 para 7 para mais espaamento entre linhas
  
  // === CAIXA ESQUERDA: DADOS DE LOCALIZAO ===
  const leftSectionStartY = sectionTitleY - 4; // Posio Y inicial da seo (incluindo espao para borda)
  const leftSectionStartX = margin - 2; // Posio X inicial da seo (com margem para borda)
  let currentYLeft = y; // Y independente para a seo esquerda
  let maxYLeft = currentYLeft;
  
  // Desenhar campos
  doc.setFontSize(10); // Aumentado de 8 para 10
  doc.setFont(undefined, 'bold');
  const labelUF = 'UF:';
  
  // Adicionar cone ICON_CAR antes do rtulo UF
  const iconX = margin;
  const iconY = currentYLeft - (iconSize - 1);
  const iconAdded = addIconSafely(doc, ICON_CAR, iconX, iconY, iconSize, iconSize);
  const iconOffset = iconAdded ? iconSize + iconTextSpacing : 0;
  
  doc.text(labelUF, margin + iconOffset, currentYLeft);
  const labelUFWidth = doc.getTextWidth(labelUF);
  const ufValueX = margin + iconOffset + labelUFWidth + labelValueSpacing;
  const maxWidthLeft = (margin + sectionContentWidth) - ufValueX - 5; // Largura disponvel na coluna esquerda
  doc.setFontSize(11); // Aumentado de 9 para 11
  doc.setFont(undefined, 'normal');
  const ufY = drawTextWithWrap(doc, registro.UF || '', ufValueX, currentYLeft, maxWidthLeft, 11, 'normal'); // Aumentado de 9 para 11
  maxYLeft = Math.max(maxYLeft, ufY);
  currentYLeft = maxYLeft + sectionLineHeight;
  
  doc.setFontSize(10); // Aumentado de 8 para 10
  doc.setFont(undefined, 'bold');
  const labelCidade = 'CIDADE:';
  
  // Adicionar cone ICON_CAR antes do rtulo CIDADE
  const iconYCidade = currentYLeft - (iconSize - 1);
  const iconAddedCidade = addIconSafely(doc, ICON_CAR, iconX, iconYCidade, iconSize, iconSize);
  const iconOffsetCidade = iconAddedCidade ? iconSize + iconTextSpacing : 0;
  
  doc.text(labelCidade, margin + iconOffsetCidade, currentYLeft);
  const labelCidadeWidth = doc.getTextWidth(labelCidade);
  const cidadeValueX = margin + iconOffsetCidade + labelCidadeWidth + labelValueSpacing;
  const maxWidthCidade = (margin + sectionContentWidth) - cidadeValueX - 5;
  doc.setFontSize(11); // Aumentado de 9 para 11
  doc.setFont(undefined, 'normal');
  const cidadeY = drawTextWithWrap(doc, registro.CIDADE || registro.Cidade || '', cidadeValueX, currentYLeft, maxWidthCidade, 11, 'normal'); // Aumentado de 9 para 11
  maxYLeft = Math.max(maxYLeft, cidadeY);
  
  // === CAIXA DIREITA: DADOS DO ROUBO/FURTO ===
  let currentYRight = y; // Y independente para a seo direita
  let maxYRight = currentYRight;
  
  // Desenhar campos
  doc.setFontSize(10); // Aumentado de 8 para 10
  doc.setFont(undefined, 'bold');
  
  // Adicionar cone ICON_CAR antes do rtulo UF
  const iconXRight = rightSectionX;
  const iconYRight = currentYRight - (iconSize - 1);
  const iconAddedRight = addIconSafely(doc, ICON_CAR, iconXRight, iconYRight, iconSize, iconSize);
  const iconOffsetRight = iconAddedRight ? iconSize + iconTextSpacing : 0;
  
  doc.text(labelUF, rightSectionX + iconOffsetRight, currentYRight);
  const ufSinistroValueX = rightSectionX + iconOffsetRight + labelUFWidth + labelValueSpacing;
  const maxWidthRightUF = (rightSectionX + sectionContentWidth) - ufSinistroValueX - 5; // Largura disponvel na coluna direita
  doc.setFontSize(11); // Aumentado de 9 para 11
  doc.setFont(undefined, 'normal');
  const ufSinistroY = drawTextWithWrap(doc, registro.UF_SINISTRO || registro.UF_Ocorrencia || '', ufSinistroValueX, currentYRight, maxWidthRightUF, 11, 'normal'); // Aumentado de 9 para 11
  maxYRight = Math.max(maxYRight, ufSinistroY);
  currentYRight = maxYRight + sectionLineHeight;
  
  doc.setFontSize(10); // Aumentado de 8 para 10
  doc.setFont(undefined, 'bold');
  
  // Adicionar cone ICON_CAR antes do rtulo CIDADE
  const iconYCidadeRight = currentYRight - (iconSize - 1);
  const iconAddedCidadeRight = addIconSafely(doc, ICON_CAR, iconXRight, iconYCidadeRight, iconSize, iconSize);
  const iconOffsetCidadeRight = iconAddedCidadeRight ? iconSize + iconTextSpacing : 0;
  
  doc.text(labelCidade, rightSectionX + iconOffsetCidadeRight, currentYRight);
  const cidadeSinistroValueX = rightSectionX + iconOffsetCidadeRight + labelCidadeWidth + labelValueSpacing;
  const maxWidthRightCidade = (rightSectionX + sectionContentWidth) - cidadeSinistroValueX - 5;
  doc.setFontSize(11); // Aumentado de 9 para 11
  doc.setFont(undefined, 'normal');
  const cidadeSinistroY = drawTextWithWrap(doc, registro.CIDADE_SINISTRO || registro.Cidade_Ocorrencia || '', cidadeSinistroValueX, currentYRight, maxWidthRightCidade, 11, 'normal'); // Aumentado de 9 para 11
  maxYRight = Math.max(maxYRight, cidadeSinistroY);
  currentYRight = maxYRight + sectionLineHeight;
  
  doc.setFontSize(10); // Aumentado de 8 para 10
  doc.setFont(undefined, 'bold');
  const labelBO = 'NMERO BO:';
  
  // Adicionar cone ICON_CAR antes do rtulo NMERO BO
  const iconYBORight = currentYRight - (iconSize - 1);
  const iconAddedBORight = addIconSafely(doc, ICON_CAR, iconXRight, iconYBORight, iconSize, iconSize);
  const iconOffsetBORight = iconAddedBORight ? iconSize + iconTextSpacing : 0;
  
  doc.text(labelBO, rightSectionX + iconOffsetBORight, currentYRight);
  const labelBOWidth = doc.getTextWidth(labelBO);
  const boValueX = rightSectionX + iconOffsetBORight + labelBOWidth + labelValueSpacing;
  const maxWidthRightBO = (rightSectionX + sectionContentWidth) - boValueX - 5;
  doc.setFontSize(11); // Aumentado de 9 para 11
  doc.setFont(undefined, 'normal');
  const boY = drawTextWithWrap(doc, registro.NUM_BO || registro.N_BO || '', boValueX, currentYRight, maxWidthRightBO, 11, 'normal'); // Aumentado de 9 para 11
  maxYRight = Math.max(maxYRight, boY);
  
  // === Desenhar bordas pretas ao redor das sees ===
  
  // As dimenses j foram calculadas acima (padding, gap, extraHeight, totalContentWidth, sectionContentWidth)
  
  // Calcular altura igual para ambas as sees (usando a altura mxima + altura extra)
  const maxContentY = Math.max(maxYLeft, maxYRight);
  const sectionContentHeight = maxContentY - y; // Altura do contedo (sem padding)
  
  // Posies X das bordas (incluindo padding)
  const leftBorderX = margin - padding;
  const rightBorderX = margin + sectionContentWidth + gap - padding;
  
  // Posies Y das bordas (incluindo padding)
  const borderStartY = sectionTitleY - 4 - padding;
  const borderHeight = sectionContentHeight + (lineHeight * 1.4) + (padding * 2) + extraHeight; // Altura incluindo ttulo, contedo, padding e altura extra
  
  // Largura da borda (incluindo padding)
  const borderWidth = sectionContentWidth + (padding * 2);
  
  doc.setDrawColor(0, 0, 0); // Cor preta
  doc.setLineWidth(0.5); // Espessura da linha
  
  // Desenhar bordas manualmente linha por linha para garantir separao completa
  // Seo "DADOS DE LOCALIZAO" (esquerda)
  const leftBorderEndX = leftBorderX + borderWidth;
  const leftBorderEndY = borderStartY + borderHeight;
  
  // Linha superior esquerda (somente para a seo esquerda)
  doc.line(leftBorderX, borderStartY, leftBorderEndX, borderStartY);
  // Linha esquerda
  doc.line(leftBorderX, borderStartY, leftBorderX, leftBorderEndY);
  // Linha inferior esquerda (somente para a seo esquerda)
  doc.line(leftBorderX, leftBorderEndY, leftBorderEndX, leftBorderEndY);
  // Linha direita (lado interno, no conecta com a outra seo)
  doc.line(leftBorderEndX, borderStartY, leftBorderEndX, leftBorderEndY);
  
  // Seo "DADOS DO ROUBO/FURTO" (direita)
  const rightBorderEndX = rightBorderX + borderWidth;
  const rightBorderEndY = borderStartY + borderHeight;
  
  // Linha superior direita (somente para a seo direita)
  doc.line(rightBorderX, borderStartY, rightBorderEndX, borderStartY);
  // Linha esquerda (lado interno, no conecta com a outra seo)
  doc.line(rightBorderX, borderStartY, rightBorderX, rightBorderEndY);
  // Linha inferior direita (somente para a seo direita)
  doc.line(rightBorderX, rightBorderEndY, rightBorderEndX, rightBorderEndY);
  // Linha direita
  doc.line(rightBorderEndX, borderStartY, rightBorderEndX, rightBorderEndY);
  
  // Atualizar Y para a posio mais baixa das duas caixas
  y = borderStartY + borderHeight + (sectionSpacing * 1); // Aumentado de sectionSpacing * 2 para sectionSpacing * 3 para mais espaamento entre sees

  // Verificar se precisa de nova pgina antes das observaes
  if (y > pageHeight - 50) { // Ajustado de 80 para 50
    doc.addPage();
    y = 12;
  }

  // --- OBSERVAES (LINHAS EM BRANCO) ---
  const observacoesTitleY = y;
  const observacoesStartY = observacoesTitleY - 4; // Posio Y inicial da seo (incluindo espao para borda)
  const observacoesStartX = margin - 2; // Posio X inicial da seo (com margem para borda)
  
  doc.setFontSize(11); // Aumentado de 9 para 11
  doc.setFont(undefined, 'bold');
  doc.text('OBSERVAES', margin, observacoesTitleY);
  y += (lineHeight * 1.4); // Aumentado de 1.2 para 1.4 para mais espaamento aps ttulo

  // Desenhar linhas em branco para preenchimento manual
  const linhaHeight = 6; // Aumentado de 5 para 6 para mais espaamento entre linhas
  const numLinhas = 5; // Aumentado de 8 para 10 (mais linhas com fonte menor)
  
  const observacoesContentStartY = y; // Posio Y onde o contedo comea
  
  doc.setFontSize(11); // Aumentado de 9 para 11
  doc.setFont(undefined, 'normal');
  doc.setDrawColor(0, 0, 0); // Cor preta para as linhas
  
  // Desenhar linhas horizontais para o funcionrio escrever
  for (let i = 0; i < numLinhas; i++) {
    // Desenhar linha horizontal
    doc.line(margin, y, rightMargin, y);
    y += linhaHeight;
    
    // Verificar se precisa de nova pgina
    if (y > pageHeight - 15) { // Ajustado de 30 para 15
      doc.addPage();
      y = 12;
    }
  }
  
  const observacoesEndY = y; // Posio Y final do contedo
  y += 3; // Reduzido de 5 para 3
  
  // Desenhar borda preta ao redor da seo de OBSERVAES
  const observacoesPadding = 3; // Padding interno (em mm)
  const observacoesBorderStartY = observacoesStartY - observacoesPadding;
  const observacoesBorderStartX = observacoesStartX - observacoesPadding;
  const observacoesBorderWidth = (rightMargin - margin) + (observacoesPadding * 2) + 4; // Largura incluindo padding e margens
  const observacoesBorderHeight = (observacoesEndY - observacoesStartY) + (lineHeight * 1.4) + (observacoesPadding * 2); // Altura incluindo ttulo, contedo e padding
  
  doc.setDrawColor(0, 0, 0); // Cor preta
  doc.setLineWidth(0.5); // Espessura da linha
  doc.rect(observacoesBorderStartX, observacoesBorderStartY, observacoesBorderWidth, observacoesBorderHeight);
  
  // Garantir que o Y no ultrapasse a pgina
  if (y > pageHeight - 12) { // Ajustado de 20 para 12
    y = pageHeight - 12;
  }

  // --- POSICIONAMENTO DO RODAP ---
  // Fora o rodap a ficar no fim da pgina atual
  if (y < pageHeight - 10) { // Ajustado de 15 para 10
      y = pageHeight - 10;
  }
  // Se a tabela terminar muito perto do fim, adiciona uma nova pgina
  if (y > pageHeight - 10) { // Ajustado de 15 para 10
      doc.addPage();
      y = pageHeight - 10;
  }

  // --- RODAP ---
  const dataGeracao = new Date().toLocaleDateString('pt-BR');
  const loginGeracao = usuarioLogado?.nome || usuarioLogado?.name || usuarioLogado?.username || 'N/A';
  
  doc.setFontSize(10); // Aumentado de 8 para 10
  doc.setFont(undefined, 'normal');
  doc.text(`DATA GERAO: ${dataGeracao}`, margin, y);
  doc.text(`LOGIN GERAO: ${loginGeracao}`, pageWidth / 2, y, { align: 'center' });
  // Conta o nmero total de pginas e exibe a pgina atual
  const pageCount = doc.internal.getNumberOfPages();
  doc.text(`${pageCount}/${pageCount}`, rightMargin, y, { align: 'right' });

  // --- SALVAR O PDF ---
  doc.save(`Protocolo_${protocolo}.pdf`);
};
